%[text] %[text:anchor:T_F7E8B9B1] # **Creating a Flight Tracking Dashboard, Part 2: Developing an Aircraft Chart**
%[text] %[text:anchor:H_701E9FF1] **Overview**
%[text] In the [first blog post](https://blogs.mathworks.com/graphics-and-apps/2024/02/08/creating-a-flight-tracking-dashboard-part-1-visualizing-an-aircraft/) of this series, we saw how to visualize a model of the aircraft together with its current attitude. In this post, we'll see how to encapsulate the 3D graphics and helper functions used to visualize the aircraft in a custom chart. 
%[text] Throughout this post, we'll use the term *chart* to refer to a MATLAB class that provides a convenient visualization API for end users. Charts are also more suitable for modular application development, since they can be dynamically updated after creation, and reused between multiple applications. For more information about charts, see the [technical article](https://www.mathworks.com/company/newsletters/articles/creating-specialized-charts-with-matlab-object-oriented-programming.html) \[1\].
%[text] By the end of this post, we'll have an aircraft chart equipped with the **`roll`**, **`pitch`**, and **`yaw`** functions for setting the attitude of the aircraft.
%[text] ![AircraftRoll.gif](text:image:6c52)
%[text] The code for this blog series is available on [GitHub](https://blogs.mathworks.com/graphics-and-apps/2024/02/08/creating-a-flight-tracking-dashboard-part-1-visualizing-an-aircraft/).
%[text:tableOfContents]{"heading":"Table of Contents"}
%%
%[text] %[text:anchor:H_BC629322] ## Create a new chart class.
%[text] Since R2019b, MATLAB provides a [framework for developing custom charts](https://www.mathworks.com/help/matlab/ref/matlab.graphics.chartcontainer.chartcontainer-class.html). We'll start by creating a new chart class within this framework, named **`AircraftChart`**.
%[text] ```matlabCodeExample
%[text] classdef AircraftChart < matlab.graphics.chartcontainer.ChartContainer
%[text] 
%[text] end
%[text] ```
%[text] In this example, the chart will only contain graphics objects. If you need your chart to contain control objects, such as buttons or check boxes, or if you need to share your chart as a reusable component in App Designer, you should use the [**`ComponentContainer`**](https://www.mathworks.com/help/matlab/ref/matlab.ui.componentcontainer.componentcontainer-class.html) framework (introduced in R2020b). Weâ€™ll see some examples of components in part 3 of this blog series.
%%
%[text] %[text:anchor:H_191FFBF7] ## Define the **`setup`** and `update` methods.
%[text] If we try to create an **`AircraftChart`** object from our class, we'll get the following error.
%[text] ```matlabCodeExample
%[text] >> AC = AircraftChart
%[text] Abstract classes cannot be instantiated. Class 'AircraftChart' inherits abstract methods or properties but does not implement
%[text] them. See the list of methods and properties that 'AircraftChart' must implement if you do not intend the class to be abstract.
%[text] ```
%[text] This is because charts derived from **`ChartContainer`** must implement the following two methods:
%[text] - **`setup`** - responsible for initializing the chart's graphics as part of the construction process.
%[text] - **`update`** - responsible for refreshing the chart's graphics when the chart's data or properties are changed by an end user. \
%[text] Let's add these methods to our **`AircraftChart`**. Note that we need to make these methods *protected* (i.e., accessible within the current class and any subclasses) for consistency with **`ChartContainer`**.
%[text] ```matlabCodeExample
%[text] classdef AircraftChart < matlab.graphics.chartcontainer.ChartContainer
%[text] 
%[text]     methods ( Access = protected )
%[text] 
%[text]         function setup( obj )
%[text] 
%[text]         end
%[text] 
%[text]         function update( obj )
%[text] 
%[text]         end
%[text] 
%[text]     end
%[text] 
%[text] end
%[text] ```
%[text] We can now create a chart object:
%[text] ```matlabCodeExample
%[text] >> AC = AircraftChart
%[text] ```
%[text] This is not very useful though - we don't yet have any data or graphics.
%%
%[text] %[text:anchor:H_C2F00636] ## Add data to the chart.
%[text] As we saw in the [first blog post](https://blogs.mathworks.com/graphics-and-apps/2024/02/08/creating-a-flight-tracking-dashboard-part-1-visualizing-an-aircraft/), the data required for the visualization can be represented conveniently as a single [**`triangulation`**](https://www.mathworks.com/help/matlab/ref/triangulation.html) object. Let's add this as a property in the **`AircraftChart`** class. As the default value, we'll use the triangulation obtained from the **`avion31`** STL file we used previously.
%[text] ```matlabCodeExample
%[text] classdef AircraftChart < matlab.graphics.chartcontainer.ChartContainer
%[text] 
%[text]     properties
%[text]         Triangulation(:, 3) triangulation = stlread( "avion31.stl" )
%[text]     end
%[text] 
%[text]     methods ( Access = protected )
%[text] 
%[text]         function setup( obj )
%[text] 
%[text]         end
%[text] 
%[text]         function update( obj )
%[text] 
%[text]         end
%[text] 
%[text]     end
%[text] 
%[text] end
%[text] ```
%[text] The end user of the chart can easily change the aircraft STL file by setting the **`Triangulation`** property.
%[text] ```matlabCodeExample
%[text] >> AC = AircraftChart
%[text] >> AC.Triangulation = stlread( "NewSTLFile.stl" );
%[text] ```
%[text] The **`update`** method is called automatically when the end user sets any public property of the chart. This is the mechanism we'll use to ensure the chart updates dynamically in response to changes made by the end user. Before we do this, we need to add graphics objects to the chart.
%%
%[text] %[text:anchor:H_8644B7E1] ## Add graphics objects to the chart.
%[text] The **`ChartContainer`** framework provides a [tiled layout](https://www.mathworks.com/help/matlab/ref/tiledlayout.html) in which to add the chart's graphics objects. We can access this tiled layout using the [**`getLayout`**](https://www.mathworks.com/help/matlab/ref/matlab.graphics.chartcontainer.chartcontainer.getlayout.html) method. The tiled layout provides the flexibility to add multiple axes, or axes with different types such as [**`geoaxes`**](https://www.mathworks.com/help/matlab/ref/geoaxes.html) or [**`polaraxes`**](https://www.mathworks.com/help/matlab/ref/polaraxes.html).
%[text] ```matlabCodeExample
%[text] function setup( obj )
%[text] 
%[text] tl = obj.getLayout();
%[text] 
%[text] end
%[text] ```
%[text]  In this example, we need to initialize the following graphics objects:
%[text] - An [**`axes`**](https://www.mathworks.com/help/matlab/ref/axes.html) object, that we'll parent to the tiled layout.
%[text] - A transform object created using [**`hgtransform`**](https://www.mathworks.com/help/matlab/ref/hgtransform.html), that we'll parent to the axes. This is used to enable easy rotation of the aircraft around the three coordinate axes.
%[text] - A [**`patch`**](https://www.mathworks.com/help/matlab/ref/patch.html) object, that we'll parent to the transform object. Recall that we used the [**`trisurf`**](https://www.mathworks.com/help/matlab/ref/trisurf.html) function to create the patch. \
%[text] First, we'll add the graphics objects as chart properties.
%[text] ```matlabCodeExample
%[text] classdef AircraftChart < matlab.graphics.chartcontainer.ChartContainer
%[text] 
%[text]     properties ( Access = private )
%[text]         Axes(:, 1) matlab.graphics.axis.Axes {mustBeScalarOrEmpty}        
%[text]         Transform(:, 1) matlab.graphics.primitive.Transform {mustBeScalarOrEmpty}
%[text]         Patch(:, 1) matlab.graphics.primitive.Patch {mustBeScalarOrEmpty}
%[text]     end
%[text] 
%[text] end
%[text] ```
%[text] There's no reason for an end user to retrieve or modify these objects directly, so we declare the attribute **`Access = private`** for these properties. 
%[text] We also add [property validation](https://www.mathworks.com/help/matlab/matlab_oop/validate-property-values.html) to ensure that these properties are used correctly within the class. Each of these properties should either be empty (when the class is first loaded) or a scalar value (when the **`setup`** method is called). Using the size validation **`(:, 1)`** combined with the validator [**`mustBeScalarOrEmpty`**](https://www.mathworks.com/help/matlab/ref/mustbescalarorempty.html) ensures that these properties either have size 0-by-1 or 1-by-1.
%[text] The type validation (e.g., **`matlab.graphics.axis.Axes`**) ensures that code within the class assigns values of the correct data type, e.g., to avoid confusion between the different types of axes. Conveniently, adding this type validation also enables tab-completion on properties of the graphics objects when these properties are referenced in methods. 
%[text] Don't worry if these class names seem long - it's easy to discover the appropriate type to use by creating a graphics object at the command line and calling the [**`class`**](https://www.mathworks.com/help/matlab/ref/class.html) function.
%[text] ```matlabCodeExample
%[text] >> class(axes)
%[text] 
%[text] ans =
%[text] 
%[text]     'matlab.graphics.axis.Axes'
%[text] ```
%[text] Next, we'll create and assign the graphics objects in the chart's **`setup`** method. This is called automatically whenever a chart object is created. Here, we place the code we used in the [first blog post](https://blogs.mathworks.com/graphics-and-apps/2024/02/08/creating-a-flight-tracking-dashboard-part-1-visualizing-an-aircraft/) for creating the axes, transform, and patch objects.
%[text] ```matlabCodeExample
%[text] function setup( obj )
%[text] 
%[text] % Obtain the chart's tiled layout.
%[text] tl = obj.getLayout();
%[text] 
%[text] % Define the color scheme used for the aircraft.
%[text] blue = [0, 0.447, 0.741];
%[text] gray = 0.95 * ones(1, 3);
%[text] onesMatrix = ones(250, 3);
%[text] paintJob = [gray .* onesMatrix; blue .* onesMatrix];            
%[text] 
%[text] % Create and customize the axes.
%[text] x = [-2000, 2000];
%[text] y = [-2500, 4500];
%[text] z = [-2500, 2500];
%[text] obj.Axes = axes( "Parent", tl, ...
%[text]     "Colormap", paintJob, ...
%[text]     "View", [225, 25], ...
%[text]     "DataAspectRatio", [1, 1, 1], ...
%[text]     "XLim", x, ...
%[text]     "YLim", y, ...
%[text]     "ZLim", z, ...
%[text]     "XTickLabel", [], ...
%[text]     "YTickLabel", [], ...
%[text]     "ZTickLabel", [], ...
%[text]     "NextPlot", "add");
%[text] 
%[text] % Add the transform and patch.
%[text] obj.Transform = hgtransform( "Parent", obj.Axes );
%[text] obj.Patch = trisurf( obj.Triangulation, ...
%[text]     "Parent", obj.Transform, ...
%[text]     "FaceAlpha", 0.9, ...
%[text]     "FaceColor", "interp", ...
%[text]     "EdgeAlpha", 0, ...
%[text]     "FaceLighting", "gouraud" );
%[text] 
%[text] % Add a title, lighting from above, and give the patch a shiny appearance by adjusting lighting properties.
%[text] title( obj.Axes, "Aircraft Attitude" )
%[text] light( obj.Axes, "Position", [0, 0, 1] )
%[text] material( obj.Axes, "shiny" )
%[text]            
%[text] end
%[text] ```
%[text] Note that we do not include creation of the figure within the chart class. This is because a chart does not own or maintain a figure. Rather, it's best to think of a chart as a graphics object that may be placed in a figure, or any other appropriate container, e.g., a tab within a tab group, a panel, another tiled layout, or a grid layout. This is an important concept when using the chart in a modular application.
%%
%[text] %[text:anchor:H_8CC72E22] ## Customize the chart's constructor.
%[text] We'd like our chart to have a convenient, user-friendly API for end users to work with. To enable autocompletion on the input arguments accepted by the chart, we'll modify the default constructor of **`AircraftChart`**. 
%[text] Chart constructors should accept name-value pair arguments, so we maintain this behavior using an [arguments block](https://www.mathworks.com/help/matlab/matlab_prog/function-argument-validation-1.html), [validating the name-value pairs](https://www.mathworks.com/help/matlab/matlab_prog/validate-name-value-arguments.html) from properties of the **`AircraftChart`** class.
%[text] We also set any name-value pairs on the chart that the end user has passed in to the constructor.
%[text] ```matlabCodeExample
%[text] function obj = AircraftChart( namedArgs )
%[text] 
%[text] arguments ( Input )
%[text]     namedArgs.?AircraftChart
%[text] end
%[text] 
%[text] % Set any user-defined properties.
%[text] set( obj, namedArgs )
%[text] 
%[text] end
%[text] ```
%%
%[text] %[text:anchor:H_C09B0640] ## Update the chart's graphics.
%[text] The **`AircraftChart`** has one public property (**`Triangulation`**). When the end user sets this property, we expect the chart to update dynamically. This is the purpose of the **`update`** method. In our example, to avoid deleting and recreating the patch object, which could impair performance, we update the properties of the existing patch. This code uses the [face-vertex representation](https://www.mathworks.com/help/matlab/creating_plots/how-patch-data-relates-to-a-colormap.html) of the patch object.
%[text] ```matlabCodeExample
%[text] function update( obj )
%[text] 
%[text] faces = obj.Triangulation(:, :);
%[text] points = obj.Triangulation.Points;            
%[text] set( obj.Patch, "Faces", faces, "Vertices", points, "FaceVertexCData", points(:, 3) )
%[text] 
%[text] end
%[text] ```
%[text] In general, we can provide end users with a rich API comprising many properties for customizing the style and appearance of the chart. The **`update`** method handles changes made by the end user to these properties by refreshing the chart's private graphics properties.
%%
%[text] %[text:anchor:H_F1572E37] ## Equip the chart with rotation methods.
%[text] Next, we'll transfer the **`roll`**, **`pitch`**, and **`yaw`** functions we discussed in the [first blog post](https://blogs.mathworks.com/graphics-and-apps/2024/02/08/creating-a-flight-tracking-dashboard-part-1-visualizing-an-aircraft/) to the **`AircraftChart`**. These will become public methods of the chart, available for end users to call.
%[text] ```matlabCodeExample
%[text] function roll( obj, theta )
%[text] 
%[text] obj.rotate( "roll", theta )
%[text] 
%[text] end % roll
%[text] 
%[text] function pitch( obj, theta )
%[text] 
%[text] obj.rotate( "pitch", theta )
%[text] 
%[text] end % pitch
%[text] 
%[text] function yaw( obj, theta )
%[text] 
%[text] obj.rotate( "yaw", theta )
%[text] 
%[text] end % yaw
%[text] ```
%[text] On the other hand, the **`rotate`** helper function will become a private chart method, since an end user should not call this method directly.
%[text] ```matlabCodeExample
%[text] function rotate( obj, type, theta )
%[text] 
%[text] arguments
%[text]     % Chart object.
%[text]     obj(1, 1) AircraftChart
%[text]     % Possible angles of rotation: roll, pitch and yaw.
%[text]     type(1, 1) string ...
%[text]         {mustBeMember( type, ["roll", "pitch", "yaw"] )}
%[text]     % Angular value to rotate by.
%[text]     theta(1, 1) double {mustBeReal, mustBeFinite} = 0
%[text] end % arguments
%[text] 
%[text] switch type
%[text]     case "roll"
%[text]         rotAxis = "y";
%[text]     case "pitch"
%[text]         rotAxis = "x";
%[text]     case "yaw"
%[text]         rotAxis = "z";
%[text] end % switch/case
%[text] 
%[text] % Convert the angle to radians and then update the
%[text] % transformation matrix.
%[text] theta = deg2rad( theta );
%[text] obj.Transform.Matrix = obj.Transform.Matrix * ...
%[text]     makehgtform( rotAxis + "rotate", theta );
%[text] 
%[text] end % rotate
%[text] ```
%[text] It's good practice to include a method for restoring the original state of the chart. We'll do this by adding a **`reset`** method that sets the transformation matrix back to its original value of $I\_4$, the 4-by-4 identify matrix.
%[text] ```matlabCodeExample
%[text] function reset( obj )
%[text] 
%[text] obj.Transform.Matrix = eye( 4 );
%[text] 
%[text] end % reset
%[text] ```
%%
%[text] %[text:anchor:H_8326C370] ## Test the chart.
%[text] We're now ready to test the chart! Let's try out a 360-degree roll. Note that weâ€™ve added a [**`pause`**](https://www.mathworks.com/help/matlab/ref/pause.html) command to slow down the animation speed and ensure that each iteration of the loop is captured as a single frame in the resulting animation.
f = figure; %[output:89f081c8]
AC = AircraftChart( "Parent", f ); %[output:89f081c8]

for k = 1 : 72 %[output:group:525b4cd5]
    AC.roll( 5 )     %[output:89f081c8]
    pause( 0.05 )
end %[output:group:525b4cd5]
%%
%[text] %[text:anchor:H_08CDD73F] ## Further charts.
%[text] Taking a similar approach, we could wrap up the graphics required for the map plot used on the dashboard into a custom chart named **`LocationChart`**. This chart encapsulates the following graphics objects:
%[text] - A geographics axes (see [**`geoaxes`**](https://www.mathworks.com/help/matlab/ref/geoaxes.html))
%[text] - Line objects used for the flight path of the aircraft and the current position marker (see [**`geoplot`**](https://www.mathworks.com/help/matlab/ref/geoplot.html)). \
%[text] In the third part of this series, weâ€™ll provide all the code for the components that make up the dashboard.
%[text] ![](text:image:2a0e)
%%
%[text] %[text:anchor:H_1ED2C0EE] ## Summary
%[text] We've seen how to take our initial visualization code for the aircraft and encapsulate it into a reusable chart. The chart can be used by colleagues as a standalone visualization within a script or function, or integrated into a larger application. We've also introduced some best programming practices for developing a chart class in MATLAB. 
%[text] In the next post, we'll see how to build up the dashboard by writing further modular components and integrating them into a MATLAB app.
%%
